import styled from 'styled-components'
import { useSelector } from "react-redux";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items:center;
  width:100%;
  padding-top: 100px;
  border: 1px solid blue;
`
const CarouSelll = styled.div`
`

const SongsList = styled.section`
  border: 1px solid pink;
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 70%;
  padding: 0 30px;
`

const Song = styled.div`
  border: 1px solid yellow;
  display: flex;
  align-items: center;
  width: 100%;
  height: 120px;
`

const SongInfo = styled.div`
  width: 86%;
  height: 100%;
  border: 1px solid orange;
  display: flex;
  align-items: center;
`

const SongButtons = styled.div`
  width: 14%;
  height: 100%;
  border: 1px solid orange;
  display: flex;
  justify-content: end;
  align-items: center;
`

const NumberDiv = styled.div`
  width: 60px;
  border: 1px solid blue;
`

const ImgDiv = styled.div`
  height: 80px;
  width: 80px;
  border: 1px solid black;
  border-radius: 10px;
`

const Music = () => {
  const songs = useSelector((store) => store.song.songs)
  return (
    <Container >
      <CarouSelll>
      </CarouSelll>
      <SongsList>
        <Song>
          <SongInfo>
            <NumberDiv>
              <h1>1</h1>
            </NumberDiv>
            <ImgDiv/>
          </SongInfo>
          <SongButtons>
          </SongButtons>
        </Song>
        <Song />
        <Song />
      </SongsList>
    </Container>
  )
}

export default Music
